  \"2015-06-19T16:41:33.794307\",\n\t\"name\": \"iowa-lidar-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is collection level metadata for LAS
  and ASCII data files from the statewide Iowa Lidar Project. The Iowa Light Detection
  and Ranging (LiDAR) Project collects location and elevation (X, Y, Z) data to a
  set standard for the entire state of Iowa. LIDAR is defined as an airborne laser
  system, flown aboard rotary or fixed-wing aircraft, that is used to acquire x, y,
  and z coordinates of terrain and terrain features that are both manmade and naturally
  occurring. LIDAR systems consist of a light-emitting scanning laser, an airborne
  Global Positioning System (GPS) with attendant GPS base station(s), and an Inertial
  Measuring Unit (IMU). The laser scanning system measures ranges from the scanning
  laser to terrain surfaces by measuring the time it takes for the emitted light (LIDAR
  return) to reach the earth's surface and reflect back to the onboard LIDAR detector.
  The airborne GPS system ascertains the in-flight three-dimensional position of the
  sensor, and the IMU delivers precise information about the attitude of the sensor.
  The LIDAR system incorporates data from these three subsystems to produce a large
  cloud of points on the land surface whose X, Y, and Z coordinates are known within
  the specified accuracy. This collection consists of ASCII files of bare earth elevations
  and intensity (x,y,z,i) and, LAS (version 1.0 lidar data interchange standard) binary
  files that include all 1st and last returns, intensity and bare earth classification.\",\n\t\"license_title\":
